import React, { useState, useEffect } from 'react';
import { Button, TableCell, TableContainer, Table, TableHead, TableBody, TableRow, Select, MenuItem, TextField, Dialog, DialogContent, DialogActions } from '@mui/material';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

function RequestAdvisor() {
    const [tableData, setTableData] = useState([]);
    const [openPopup, setOpenPopup] = useState(false);

    useEffect(() => {
        // ดึงข้อมูลจาก API
        fetch('http://localhost:9999/Project')
            .then(response => response.json())
            .then(data => {
                setTableData(data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);

    const handlePopupClick = () => {
        setOpenPopup(true);
    };

    const handlePopupClose = () => {
        setOpenPopup(false);
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <div>
                                <h1>สถานะคำร้องขอเป็นอาจารย์ที่ปรึกษา</h1>
                                <TableContainer>
                                    <Table>
                                        <TableHead>
                                            <TableRow>
                                                <TableCell>ลำดับที่</TableCell>
                                                <TableCell>ชื่อโครงงาน</TableCell>
                                                <TableCell>นักศึกษาคนที่ 1</TableCell>
                                                <TableCell>นักศึกษาคนที่ 2</TableCell>
                                            </TableRow>
                                        </TableHead>
                                        <TableBody>
                                            {tableData.length > 0 ? (
                                                tableData.map((row, index) => (
                                                    <TableRow key={row.ID}>
                                                        <TableCell>{index + 1}</TableCell>
                                                        <TableCell>{row.Name}</TableCell>
                                                        <TableCell>{row.Student1}</TableCell>
                                                        <TableCell>{row.Student2}</TableCell>
                                                    </TableRow>
                                                ))
                                            ) : (
                                                <TableRow>
                                                    <TableCell colSpan={4} align="center">
                                                        No data available
                                                    </TableCell>
                                                </TableRow>
                                            )}
                                        </TableBody>
                                    </Table>
                                </TableContainer>
                                <Dialog open={openPopup} onClose={handlePopupClose}>
                                    <DialogContent>
                                        รายละเอียดโดยย่อของโครงงานที่จะแสดงในนี้จะต้องดึงข้อมุลมาจากรายละเอียดของโครงงานที่จะพัฒนาจากการกรอกข้อมูลยื่นสอบหัวข้อ
                                    </DialogContent>
                                    <DialogActions>
                                        <Button onClick={handlePopupClose}>Close</Button>
                                    </DialogActions>
                                </Dialog>
                            </div>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
}

export default RequestAdvisor;
